data:
  definition: catégorie de service définie par les caractéristiques des communications
    offertes à un usager d'un service public de télécommunication
  examples: []
  notes:
  - Les caractéristiques définies pour une catégorie d'usager peuvent être par exemple
    le débit binaire, le mode d'établissement des communications, le mode d'exploitation
    du terminal, la structure du code, les restrictions de service.
